import ArticleEmployment from 'components/common/ArticleEmployment';
import React from 'react';
import styled from 'styled-components';
import SearchFilter from './SearchFilter';

function SearchBody() {
	return (
		<ComponentWrapper>
			<div className="search-container">
				<h2 className="search-label">
					연관 직무<span>1</span>
				</h2>
				<div className="category-tag-container">
					<a href="/wdlist/4" className="category-tagitem">
						프론트엔드 개발자
					</a>
				</div>
			</div>
			<div className="search-container">
				<h2 className="search-label">
					포지션 <span>000개</span>
				</h2>
			</div>
			<SearchFilter />
			<div className="list-container">
				<ul>
					<li>
						<ArticleEmployment />
					</li>
					<li>
						<ArticleEmployment />
					</li>
				</ul>
			</div>
		</ComponentWrapper>
	);
}

const ComponentWrapper = styled.div`
	margin: 60px auto 80px;
	width: 87.72%;
	position: relative;
	max-width: 1060px;
	.list-container {
		ul {
			margin: -10px;
			padding: 0px;
			> li {
				width: 25%;
				padding: 10px;
				list-style: none;
				display: inline-block;
				vertical-align: top;
			}
		}
	}
	.search-container {
		padding-bottom: 60px;
	}
	.search-label {
		font-size: 24px;
		font-weight: 600;
		line-height: 36px;
		margin-bottom: 18px;
		color: #333;
		> span {
			margin-left: 10px;
			font-weight: 400;
		}
	}
	.category-tag-container {
		position: relative;
		width: 100%;
		text-align: left;
		.category-tagitem {
			display: inline-block;
			background-color: #fff;
			text-align: center;
			padding: 0 18px;
			height: 40px;
			line-height: 40px;
			border: 1px solid #e1e2e3;
			border-radius: 20px;
			font-size: 16px;
			font-weight: 400;
			color: #333;
			margin: 0 6px 6px 0;
			font-family: inherit;
		}
	}

	/* .CompanyList_className__onSYS {
		margin: -10px;
		position: relative;
		scrollbar-width: none;
	} */
`;

export default SearchBody;
